import { StyleSheet} from 'react-native';

const containerStyles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#1e2833',
      alignItems: 'center',
      justifyContent: 'center',
    },
});
export {containerStyles};
